import "./panel.css";

function Panel() {
  return (
    <>
      <div className="App">
        <div className="canvas">main panel</div>
        <div className="panel">
          <h2 className="skethTitle">main panel</h2>
        </div>
      </div>
    </>
  );
}

export default Panel;
